INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (10, 0, 10, 5, "vo_minigame_1012_result_1004", 1, 1, 2, 10, 11300105, 3001, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 1.31);
