INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 5, 1, "vo_minigame_1012_result_1080", 2, 1, 1, 9, 12300148, 3001, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 0.0);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (8, 0, 5, 1, "vo_minigame_1012_result_1081", 2, 1, 2, 9, 12300149, 3001, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 2.21);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 5, 1, "vo_minigame_1012_result_1082", 2, 1, 2, 9, 12300150, 3001, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2.46);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 5, 1, "vo_minigame_1012_result_1083", 2, 1, 2, 9, 12300151, 3001, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2.94);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (7, 0, 5, 1, "vo_minigame_1012_result_1084", 2, 1, 3, 9, 12300152, 3001, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 4.19);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (1, 0, 5, 1, "vo_minigame_1012_result_1085", 2, 1, 3, 9, 12300153, 3001, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 0.0);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 5, 1, "vo_minigame_1012_result_1086", 2, 1, 3, 9, 12300154, 3001, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 2.63);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 1, 1, "vo_minigame_1012_result_1087", 2, 1, 1, 4, 12300155, 3001, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 5.53);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 9, 1, 3, "vo_minigame_1012_result_1088", 2, 1, 1, 4, 12300156, 3001, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 0.01);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 3, 1, 1, "vo_minigame_1012_result_1089", 2, 1, 1, 4, 12300157, 3001, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 4.15);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (9, 9, 1, 9, "vo_minigame_1012_result_1090", 2, 1, 2, 4, 12300158, 3001, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 0.01);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 1, 1, "vo_minigame_1012_result_1091", 2, 1, 2, 4, 12300159, 3001, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 5.37);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 1, 1, "vo_minigame_1012_result_1092", 2, 1, 2, 4, 12300160, 3001, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1.44);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 1, 3, "vo_minigame_1012_result_1093", 2, 1, 3, 4, 12300161, 3001, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 0.0);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 3, 1, 9, "vo_minigame_1012_result_1094", 2, 1, 3, 4, 12300162, 3001, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 2.91);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (5, 0, 1, 1, "vo_minigame_1012_result_1095", 2, 1, 3, 4, 12300163, 3001, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 2.61);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (4, 1, 0, 2, "vo_minigame_1012_result_1096", 2, 1, 1, 0, 12300164, 3001, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 3.63);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (6, 1, 0, 2, "vo_minigame_1012_result_1097", 2, 1, 1, 0, 12300165, 3001, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 4.16);
