INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (4, 3, 1, 10, "vo_minigame_1012_result_2092", 2, 2, 2, 4, 22300160, 3001, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 4.29);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (4, 6, 1, 8, "vo_minigame_1012_result_2093", 2, 2, 3, 4, 22300161, 3001, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 4.64);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (9, 0, 1, 5, "vo_minigame_1012_result_2094", 2, 2, 3, 4, 22300162, 3001, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 3.14);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (7, 0, 1, 4, "vo_minigame_1012_result_2095", 2, 2, 3, 4, 22300163, 3001, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 6.59);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3, 0, 0, 3, "vo_minigame_1012_result_2096", 2, 2, 1, 0, 22300164, 3001, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 0.0);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (9, 5, 0, 10, "vo_minigame_1012_result_2097", 2, 2, 1, 0, 22300165, 3001, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 2.2);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (4, 6, 0, 4, "vo_minigame_1012_result_2098", 2, 2, 1, 0, 22300166, 3001, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 0.01);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (6, 3, 0, 2, "vo_minigame_1012_result_2099", 2, 2, 2, 0, 22300167, 3001, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 2.8);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (9, 6, 0, 4, "vo_minigame_1012_result_2100", 2, 2, 2, 0, 22300168, 3001, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 3.22);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (4, 11, 0, 0, "vo_minigame_1012_result_2101", 2, 2, 2, 0, 22300169, 3001, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 2.1);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 3, 0, 2, "vo_minigame_1012_result_2102", 2, 2, 3, 0, 22300170, 3001, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 2.74);
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (6, 9, 0, 9, "vo_minigame_1012_result_2103", 2, 2, 3, 0, 22300171, 3001, "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？", 3.0);
